import os
import uuid
import pandas as pd
from datetime import datetime
import re

class Validator:
    @staticmethod
    def validate_duns(duns_number, action_type):
        """Validate DUNS number for specific action types, checking if registered in SAM."""
        if not duns_number or not isinstance(duns_number, str) or len(duns_number) != 9 or not duns_number.isdigit():
            return False
        # Simulate SAM check (in reality, this would call an API or query a database)
        return action_type in ["contract", "grant"]  # Example condition

    @staticmethod
    def validate_file_extension(filename):
        """Ensure only CSV or XLSX files are processed."""
        return filename.lower().endswith(('.csv', '.xlsx'))

class FileManager:
    @staticmethod
    def generate_request_id():
        """Generate a unique request ID for tracking files."""
        return str(uuid.uuid4())

    @staticmethod
    def is_duplicate_file(file_hash, cache):
        """Prevent duplicate file publishing by checking against a cache."""
        return file_hash in cache

class DataLoader:
    @staticmethod
    def load_fpds_data(file_path):
        """Load historical FPDS data for analysis."""
        try:
            if file_path.endswith('.csv'):
                return pd.read_csv(file_path)
            elif file_path.endswith('.xlsx'):
                return pd.read_excel(file_path)
            else:
                raise ValueError("Unsupported file format")
        except Exception as e:
            print(f"Error loading file: {e}")
            return None

class DataProcessor:
    @staticmethod
    def derive_funding_agency_code(record):
        """Derive funding agency codes from records."""
        # Example logic: extract first 2 chars of a specific field
        return record.get("funding_agency", "")[:2].upper() if record.get("funding_agency") else "UNKNOWN"

    @staticmethod
    def derive_office_name(code):
        """Derive office names from codes for readability."""
        office_map = {"DOD": "Department of Defense", "HHS": "Health and Human Services", "ED": "Education"}
        return office_map.get(code, "Unknown Office")

class UXTesting:
    def __init__(self):
        self.sessions = {}

    def schedule_testing_session(self, session_name, participants):
        """Schedule a user testing session."""
        session_id = f"session_{len(self.sessions) + 1}"
        self.sessions[session_id] = {
            "name": session_name,
            "participants": participants,
            "scheduled_time": datetime.now(),
            "results": None
        }
        return session_id

    def report_testing_results(self, session_id, results):
        """Report user testing results for a session."""
        if session_id in self.sessions:
            self.sessions[session_id]["results"] = results
            return True
        return False

class SubmissionManager:
    def __init__(self):
        self.submissions = {}

    def update_status(self, submission_id, status):
        """Update submission status labels in the dashboard."""
        if submission_id in self.submissions:
            self.submissions[submission_id]["status"] = status
            return True
        return False

    def add_submission(self, submission_id, initial_status="pending"):
        """Add a new submission with an initial status."""
        self.submissions[submission_id] = {
            "status": initial_status,
            "timestamp": datetime.now(),
            "history": []
        }

    def log_history(self, submission_id, action, outcome):
        """Log an action and outcome to submission history."""
        if submission_id in self.submissions:
            self.submissions[submission_id]["history"].append({
                "action": action,
                "outcome": outcome,
                "timestamp": datetime.now()
            })
            return True
        return False

    def get_submission_history(self, submission_id):
        """Retrieve submission history for auditing."""
        return self.submissions.get(submission_id, {}).get("history", [])

class SystemIntegrator:
    @staticmethod
    def sync_fpds_data(fpds_data, d1_data):
        """Sync FPDS data with D1 generation to keep the system up-to-date."""
        # Example: Merge FPDS data with D1 data on a common key
        return pd.merge(fpds_data, d1_data, on="contract_id", how="outer")
